import React, { useState } from 'react';
import { Card, TextField, Button, Typography, Grid } from '@mui/material';
import { green } from '@mui/material/colors';
import axios from 'axios';

const BASE_URL = 'http://localhost:8080'

function Input() {
  const [add1, setAdd1] = useState(0)
  const [add2, setAdd2] = useState(0)

  const calculate = async () => {
    console.log('here', add1, add2)
    try {
        const res = await axios.post(`${BASE_URL}/calculate`, { add1, add2})
        console.log(res.data)
    } catch (error) {
        console.log(error)
    }
  }


  return (
    <Grid container justifyContent="center">
    <Card sx={{ display: "flex", flexDirection: "column", alignItems: "center", m: 2, p: 2, width: 800 }} elevation={4}>
      <TextField 
        label="value1" 
        value={add1} 
        onChange={e => setAdd1(e.target.value)} 
        variant="outlined" 
        fullWidth 
      />
      <TextField 
        label="value2" 
        value={add2} 
        onChange={e => setAdd2(e.target.value)} 
        variant="outlined" 
        fullWidth 
      />
      <Button variant="contained" color="primary" onClick={calculate} sx={{ mt: 2 }}>
        Shorten
      </Button>
    </Card>
  </Grid>
  );
}

export default Input;
